import './Skills.css';
import AboutImage from '../../images/HomePage.jpeg';


const Skills = () =>{
    return(

      <section id="Skills">
        <div className='SkillsHeader'>
          <br/>
          <span className='SkillsHeader_span'>Skills</span>
        </div>
        <section className='Skills_Body'>
            <div>Fornt End</div>
            <div>Back End</div>
            <div>Data Bases</div>
            <div>Cloud</div>
        </section>    
      </section>

    )
}
export default Skills;
